public FounderHighlighter highlight = null;
protected class FounderHighlighter extends QSyntaxHighlighter {

    public QTextCharFormat foundedFormat;
    private Str searchWord = "";
    private boolean matchCase = false;
    private int counter;

    public FounderHighlighter(QTextDocument document, Str word, boolean matchCase) {
        this(document);
        this.searchWord = word;
        counter = 0;
        rehighlight();
    }

    public FounderHighlighter(QTextDocument document) {
        super(document);
        foundedFormat = new QTextCharFormat();
        foundedFormat.setBackground(new QBrush(QColor.yellow));

    }

    public void setSearchWord(Str word) {
        this.searchWord = word;
        counter = 0;
        rehighlight();
    }
    public void setMatchCase(boolean matchCase) {
        this.matchCase = matchCase;
        counter = 0;
        rehighlight();
    }
    public int getCounter(){
        return counter;
    }
    public void setCounter(int counter){
        this.counter = counter;
    }
    @Override
    public void highlightBlock(

 text) {
        if (searchWord==null || searchWord.isEmpty())
            return;
        if (!matchCase){
            text = text.toLowerCase();
            searchWord = searchWord.toLowerCase();
        }

        int start = 0, end = 0, len = searchWord.length();
        int pos = text.indexOf(searchWord);

        while (pos != -1) {

            counter+=1;
            start = pos;
            end = pos + len;
            setFormat(start, len, foundedFormat);
            pos = text.indexOf(searchWord, end+1);      
        }
    }
}

